(804, 'wpb_js_templates', 'a:15:{s:58:"wysiwyg-avec-barre-verticale-animee-dencadrement_948581120";a:2:{s:4:"name";s:50:"Wysiwyg avec barre verticale animée d\'encadrement";s:8:"template";s:1214:"[vc_row][vc_column width="1/3"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][vc_column_text]\n<h3 style="text-align: center;">Alexandre Gauthier</h3>\n<h2 style="text-align: center;">Biographie</h2>\n<p style="text-align: justify;">Alexandre Gauthier né le 26 mars 1979 à Boulogne-sur-Mer est un chef cuisinier français. Propriétaire du restaurant La Grenouillère situé à La Madelaine-sous-Montreuil dans le Pas-de-Calais. Il est le fils de Roland Gauthier.</p>\n<p style="text-align: justify;">En février 2003, il reprend les cuisines de La Grenouillère qui appartenaient à son père. Créée dans les années 1930, l’auberge était dirigée par Roland Gauthier depuis 1979. En 2007, il ouvre une rôtisserie contemporaine « Froggy’s Tavern » à Montreuil-sur-Mer et en 2009 « Les grandes tables du Channel » à Calais puis en 2015 «Anecdote» à Montreuil-sur-Mer. Il participe à de nombreux festivals et colloques où il présente sa cuisine en France et à l\'étranger.</p>\n\n[/vc_column_text][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/3"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row]";}s:15:"cuisinier_14084";a:2:{s:4:"name";s:9:"cuisinier";s:8:"template";s:1827:"[vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/3"][vc_column_text css_animation="bottom-to-top"]\n<h3 style="text-align: center;">Alexandre Gauthier</h3>\n<h2 style="text-align: center;">Cuisinier</h2>\n<p style="text-align: justify;">Je suis né cuisinier.\nJ’ai repris en 2003 le restaurant familial « La Grenouillère » situé près de Montreuil-sur-Mer dans le Pas de Calais.\nJ’y pratique une cuisine d’auteur, singulière, sincère. Je l’ancre avec humilité dans mon territoire de la côte d’Opale que j’explore dans tous ses aspects, naturels et humains. J’y propose une cuisine contemporaine de souche et de racine françaises, libérée de ses certitudes et de ses a priori.\nJ’ai confié en 2009 à l’architecte Patrick Bouchain la rénovation du restaurant pour en faire un lieu d’aujourd’hui. J’ai en effet l’ambition que La Grenouillère soit beaucoup plus qu’un grand restaurant.\nLa Grenouillère est une Maison de liberté et d’expression pour ceux qui l’habitent et la vivent avec moi.\n\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row]";}s:15:"alentours_30053";a:2:{s:4:"name";s:9:"alentours";s:8:"template";s:3760:"[vc_row][vc_column width="1/3"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row][vc_column width="1/3"][/vc_column][vc_column width="1/3"][vc_column_text]\n<h3 style="text-align: center;"><span style="color: #f8d09e;">Aller plus loin</span></h3>\n<h2 style="text-align: center;">Les alentours</h2>\n[/vc_column_text][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row css=".vc_custom_1445531296300{padding-right: 100px !important;padding-left: 100px !important;}"][vc_column][vc_row_inner][vc_column_inner width="1/4" offset="vc_hidden-sm vc_hidden-xs"][/vc_column_inner][vc_column_inner width="1/4"][vc_column_text]\n<p style="text-align: left;"><span style="font-weight: bold; font-size: 1.2em;">Golf : </span>\nLe touquet, Hardelot, Belle Dune\n\n<span style="font-weight: bold; font-size: 1.2em;">Marchés: </span>\nMontreuil-sur-mer, à 2km : Samedi\nEtaples-sur-Mer, à 12km : Mercredi et Samedi\nLe Touqet-Paris-PLage, à 17km : Lundi (uniquement l\'été), Jeudi et Samedi\nHesdin, à 30km : Jeudi\nBoulogne-sur-Mer, à 40Km : Mercredi et Dimanche\n\n<span style="font-weight: bold; font-size: 1.2em;">Visite de nos producteurs</span>[/vc_column_text][/vc_column_inner][vc_column_inner width="1/4"][vc_column_text]\n<p style="text-align: left;"><span style="font-weight: bold; font-size: 1.2em;">Villes et plages : </span>\nLe Touquet (17Km), Le Crotoy (42Km),\nSaint Valery-sur-Somme (47km), Honfleur (212Km)\n<span style="font-weight: bold; font-size: 1.2em;">Culture :</span>\nAbbaye et Jardins de Valloires\nLa chartreuse de Neuville\nMusée d\'art contemporain du touquet\nLe Channel, Scène nationale de Calais\n\nPlus encore sur <a href="http://www.tourisme-montreuillois.com/" target="_blank">www.tourisme-montreuillois.com</a>[/vc_column_text][/vc_column_inner][vc_column_inner width="1/4" offset="vc_hidden-sm vc_hidden-xs"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row css=".vc_custom_1445531296300{padding-right: 100px !important;padding-left: 100px !important;}"][vc_column offset="vc_hidden-lg vc_hidden-md vc_hidden-sm"][vc_row_inner][vc_column_inner width="1/4" offset="vc_hidden-sm vc_hidden-xs"][/vc_column_inner][vc_column_inner width="1/4"][vc_column_text]\n<p style="text-align: left;"><span style="font-weight: bold; font-size: 1.2em;">Golf : </span>\nLe touquet, Hardelot, Belle Dune\n<span style="font-weight: bold; font-size: 1.2em;">Marchés: </span>\nMontreuil-sur-mer, à 2km : Samedi\nEtaples-sur-Mer, à 12km : Mercredi et Samedi\nLe Touqet-Paris-PLage, à 17km : Lundi (uniquement l\'été), Jeudi et Samedi\n<span style="font-weight: bold; font-size: 1.2em;">Visite de nos producteurs</span>\n\n[/vc_column_text][/vc_column_inner][vc_column_inner width="1/4"][vc_column_text]\n<p style="text-align: left;"><span style="font-weight: bold; font-size: 1.2em;">Villes et plages : </span>\nLe Touquet (17Km), Le Crotoy (42Km), Saint Valery-sur-Somme (47km), Honfleur (212Km)\n<span style="font-weight: bold; font-size: 1.2em;">Culture :</span>\nAbbaye et Jardins de Valloires\nLa chartreuse de Neuville\nMusée d\'art contemporain du touquet\n\nPlus encore sur <a href="http://www.tourisme-montreuillois.com/" target="_blank">www.tourisme-montreuillois.com</a>[/vc_column_text][/vc_column_inner][vc_column_inner width="1/4" offset="vc_hidden-sm vc_hidden-xs"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row][vc_column width="1/3"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row]";}s:10:"lieu_24440";a:2:{s:4:"name";s:4:"lieu";s:8:"template";s:824:"[vc_row][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/3"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row][vc_column width="1/3"][vc_column_text]\n<h3 style="text-align: center;">Aller plus loin</h3>\n<h2 style="text-align: center;">Le lieu</h2>\n<p style="text-align: center;">Galerie actuellement en construction</p>\n\n[/vc_column_text][/vc_column][vc_column width="1/3"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/3"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row]";}s:11:"acces_11022";a:2:{s:4:"name";s:5:"acces";s:8:"template";s:2142:"[vc_row][vc_column width="1/3"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="237" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row][vc_column width="1/3"][/vc_column][vc_column width="1/3"][vc_column_text]\n<h3 style="text-align: center;">Venir</h3>\n<h2 style="text-align: center;">Accès</h2>\n<p style="text-align: center;">La Grenouillère, 19 rue de la Grenouillère 62170 La Madelaine-sous-Montreuil\n(<a href="https://goo.gl/maps/iFqbb18qNU82" target="_blank">ouvrir dans google maps</a>)\n\n[/vc_column_text][vc_separator color="chino" style="dotted" el_width="20" el_class="hr_acces"][vc_column_text]\n<h3 style="text-align: center;">En voiture</h3>\n<p style="text-align: center;">Coordonnées GPS\nLatitude 50.4707957 - Longitude 1.7546691999999\n\n[/vc_column_text][vc_separator color="chino" style="dotted" el_width="20" el_class="hr_acces"][vc_column_text]\n<h3 style="text-align: center;">En train</h3>\n<p style="text-align: center;"><a href="http://www.ter.sncf.com/nord-pas-de-calais/gares/87317164/Montreuil%20sur%20Mer/prochains-departs" target="_blank">Gare de Montreuil-sur-Mer</a>, à 4 km\n<a href="http://www.gares-sncf.com/fr/gare/frcvu/rang-du-fliers-verton-berck" target="_blank">Gare de Rang-du-Fliers</a>, à 12 km\n<a href="http://www.gares-sncf.com/fr/gare/freta/etaples-touquet" target="_blank">Gare d\'Etaples le Touquet</a>, à 12 km\nTaxi de la gare à La Grenouillère sur réservation :\nAllo Taxi Montreuil +33669380100\n\n[/vc_column_text][vc_separator color="chino" style="dotted" el_width="20" el_class="hr_acces"][vc_column_text]\n<h3 style="text-align: center;">En hélicoptère...</h3>\n<p style="text-align: center;">Atterrissage à La Grenouillère sur rendez-vous</p>\n\n[/vc_column_text][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row][vc_column width="1/3"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="237" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row]";}s:13:"reserver_9969";a:2:{s:4:"name";s:8:"reserver";s:8:"template";s:1477:"[vc_row][vc_column width="2/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="237" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row][vc_column width="2/3"][vc_column_text]\n<h3 style="text-align: center;">Venir</h3>\n<h2 style="text-align: center;">Réserver</h2>\n<p style="text-align: center;">Pour vos réservation, merci de nous contacter :\n<a class="listButton" href="tel:+33321060722"> Tél. +33 3 21 06 07 22 </a>\n<a href="mailto:contact@lagrenouillere.fr">contact@lagrenouillere.fr</a>\n\n[/vc_column_text][vc_separator color="black" style="dashed" el_width="30"][vc_column_text]\n<h3 style="text-align: center;">Ouvertures</h3>\n<p style="text-align: center;"><strong>Printemps et Automne</strong>\n(Septembre, Octobre, Avril, Mai &amp; Juin)\nDéjeuner : Vendredi, Samedi et Dimanche\nDîner : Du Mercredi au Lundi\n\n<p style="text-align: center;"><strong>Eté</strong>\n(Juillet et Août)\nDéjeuner et dîner : Tous les jours sauf le déjeuner le Mardi\n\n<p style="text-align: center;"><strong>Hiver</strong>\n(Novembre à Mars inclus)\nDéjeuner : Vendredi, Samedi et Dimanche\nDîner : Du Jeudi au Lundi\n\n[/vc_column_text][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row][vc_column width="2/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="237" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row]";}s:14:"petit-dej_1393";a:2:{s:4:"name";s:9:"petit dej";s:8:"template";s:1419:"[vc_row][vc_column width="1/4"][/vc_column][vc_column width="1/2" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/4"][/vc_column][/vc_row][vc_row][vc_column width="1/4"][/vc_column][vc_column width="1/2"][vc_column_text]\n<h3 style="text-align: center;">Dormir</h3>\n<h2 style="text-align: center;">Séjours et petits déjeuners</h2>\n[/vc_column_text][vc_row_inner][vc_column_inner width="1/2"][vc_column_text]\n<h4 style="text-align: center;">Séjours</h4>\n<p style="text-align: center;">En semaine du Dimanche au Jeudi\n1 nuit + petits déjeuners\n2 menus dégustation (en 9 services) à la Grenouillère\nVin, cafés et eau compris\n2 personnes : 600€\nSauf Vendredi, Samedi et veille de jours fériés\n\n[/vc_column_text][/vc_column_inner][vc_column_inner width="1/2"][vc_column_text]\n<h4 style="text-align: center;">Petits déjeuners</h4>\n<p style="text-align: center;">De 8h00 à 10h30\nPetit déjeuner\nServi en salle, en exterieur ou en chambre.\n22,50€\n\n[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][vc_column width="1/4"][/vc_column][/vc_row][vc_row][vc_column width="1/4"][/vc_column][vc_column width="1/2" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/4"][/vc_column][/vc_row]";}s:11:"hutte_25084";a:2:{s:4:"name";s:5:"hutte";s:8:"template";s:1103:"[vc_row][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/3" offset="vc_hidden-xs"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row][vc_column width="1/3"][vc_column_text css_animation="bottom-to-top"]\n<h3 style="text-align: center;">Dormir</h3>\n<h2 style="text-align: center;">Les huttes</h2>\n<p style="text-align: center;">Un moment hors du temps, en plein cœur de la nature</p>\n\n[/vc_column_text][vc_btn title="En savoir plus" style="outline" shape="square" color="chino" a