h="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/3"][vc_column_text css_animation="bottom-to-top"]\n<h3 style="text-align: center;">Alexandre Gauthier</h3>\n<h2 style="text-align: center;">Cuisinier</h2>\n<p style="text-align: justify;">Je suis né cuisinier.\nJ’ai repris en 2003 le restaurant familial « La Grenouillère » situé près de Montreuil-sur-Mer dans le Pas de Calais.\nJ’y pratique une cuisine d’auteur, singulière, sincère. Je l’ancre avec humilité dans mon territoire de la côte d’Opale que j’explore dans tous ses aspects, naturels et humains. J’y propose une cuisine contemporaine de souche et de racine françaises, libérée de ses certitudes et de ses a priori.\nJ’ai confié en 2009 à l’architecte Patrick Bouchain la rénovation du restaurant pour en faire un lieu d’aujourd’hui. J’ai en effet l’ambition que La Grenouillère soit beaucoup plus qu’un grand restaurant.\nLa Grenouillère est une Maison de liberté et d’expression pour ceux qui l’habitent et la vivent avec moi.\n\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row]";}s:19:"contemportain_16976";a:2:{s:4:"name";s:13:"contemportain";s:8:"template";s:4306:"[vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row css=".vc_custom_1446200325585{margin-right: 30px !important;margin-left: 30px !important;padding-right: 30px !important;padding-left: 30px !important;}"][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3"][vc_column_text]\n<h3 style="text-align: center;">Alexandre Gauthier</h3>\n<h2 style="text-align: center;">Contemporain</h2>\n<p style="text-align: justify;">Je pratique une cuisine contemporaine en proposant ma vision d’un goût et d’un territoire, qui assume pleinement qui je suis.\nÊtre contemporain, vivre dans son époque, c’est aussi dialoguer avec d’autres univers, recevoir des marques d’estime, faire voyager sa cuisine en dehors des frontières.\nLa Grenouillère est une maison de cuisinier, une maison de partage, de liberté et d’expression. 12 ans de travail, de rencontres, d’échanges, de passion et d’envies au quotidien, jour après jour, mois après mois…12 ans de mouvement permanent.\nJ’aime cette recette de Daniel Rondeau <em>« La meilleure façon de préparer l’avenir est de tout donner au présent »</em>.\n\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6" offset="vc_hidden-lg vc_hidden-md vc_hidden-sm vc_hidden-xs"][/vc_column][vc_column width="1/6" offset="vc_hidden-lg vc_hidden-md vc_hidden-sm vc_hidden-xs"][/vc_column][vc_column width="1/6" offset="vc_hidden-lg vc_hidden-md vc_hidden-sm vc_hidden-xs"][/vc_column][vc_column width="1/3" offset="vc_hidden-lg vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_separator color="chino" style="dotted"][vc_empty_space height="20"][vc_row_inner][vc_column_inner width="1/6"][vc_btn title="2016" style="outline" shape="square" color="chino" size="xs" align="center" el_class="popmake-2016"][/vc_column_inner][vc_column_inner width="1/6"][vc_btn title="2015" s