"center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row]";}s:13:"cuisine_14861";a:2:{s:4:"name";s:7:"cuisine";s:8:"template";s:1380:"[vc_row][vc_column width="1/6" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][vc_single_image image="237" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][vc_column_text]\n<div style="width: 150px;">\n<h3 style="text-align: center;">Manger</h3>\n<h2 style="text-align: center;">La cuisine</h2>\n<p style="text-align: right;">territoire…\nsaison…\nhommes…\nfemmes…\ntechniques…\ncuisson…\nchasse…\npêche…\nculture…\nagriculture…\nmaraîchage…\nélevage…\ncueillette…\nsavoir faire…\nhumeur…\nune idée…\n\n<p style="text-align: left;">…et prendre du plaisir.</p>\n\n</div>\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][vc_single_image image="237" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row]";}s:15:"restaurant_7812";a:2:{s:4:"name";s:10:"restaurant";s:8:"template";s:1462:"[vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6" offset="vc_hidden-xs"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6" offset="vc_hidden-xs"][/vc_column][vc_column width="1/3"][vc_column_text css=".vc_custom_1445607983863{padding-right: 20px !important;padding-left: 20px !important;}"]\n<h3 style="text-align: center;">Manger</h3>\n<h2 style="text-align: center;">Le restaurant</h2>\n<p style="text-align: justify;">Entre forge, fumoir et séchoir à houblon.\nOuvert la journée sur une nature verdoyante, le jardin de Tiphaine Hameau. La nuit tombant, l’obscurité venant la salle se renferme sur elle-même pour créer l’intimité sous un ciel étoilé.\nL’équipe de salle menée par Pascal Garnier vous accompagne dans ce moment de partage.\n\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row]";}s:11:"carte_27397";a:2:{s:4:"name";s:5:"carte";s:8:"template";s:1341:"[vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3"][vc_column_text]\n<h3 style="text-align: center;">Manger</h3>\n<h2 style="text-align: center;">La carte</h2>\n<p style="text-align: center;">Carte éditée chaque jour...\nCuisine, photographie gustative de l’instant.\nMenu 9 services : 95€\nMenu 11 services : 125€\nCarte de 35 à 85€\n\n<p style="text-align: center;">La carte des vins se compose de près de 500 références. Elle propose des vins de toute la France, toutes ses régions. Elle est vivante, ouverte à tous, sans a priori.</p>\n\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row]";}s:13:"accueil_24833";a:2:{s:4:"name";s:7:"accueil";s:8:"template";s:4212:"[vc_row][vc_column width="1/4"][/vc_column][vc_column width="1/2" offset="vc_hidden-md vc_hidden-xs"][vc_single_image image="207" img_size="full" alignment="center"][/vc_column][vc_column width="1/4"][/vc_column][/vc_row][vc_row][vc_column width="1/4"][/vc_column][vc_column width="1/2" offset="vc_hidden-lg vc_hidden-md vc_hidden-sm"][vc_column_text el_class="adr" css=".vc_custom_1445877327961{margin-left: 110px !important;border-left-width: 2px !important;padding-top: 20px !important;border-left-color: #ffffff !important;}"]\n<p style="text-align: center;">19 rue de la Grenouillère\n62170 La Madelaine-sous-Montreuil\n<a style="color: #fcd6a5;" href="mailto:contact@lagrenouillere.fr">contact@lagrenouillere.fr</a>\n\n[/vc_column_text][vc_separator color="chino" border_width="3" el_width="90"][vc_column_text css=".vc_custom_1451911669186{background-color: rgba(0,0,0,0.77) !important;*background-color: rgb(0,0,0) !important;}"]\n<p style="text-align: center; color: #ffffff; font-weight: 500; font-size: 1.4em;">La Grenouillère est actuellement fermée.\nRéouverture le 29 janvier pour le dîner.\n\n[/vc_column_text][vc_separator color="chino" border_width="3" el_width="90"][vc_empty_space height="70px"][vc_single_image image="322" img_size="medium" alignment="center" css_animation="appear"][vc_empty_space height="70px"][vc_btn title="Réserver par téléphone" style="outline" shape="square" color="default" size="lg" align="cente