e personnes viennent sur le site si aucune conversion n’est faite. Et c’est là, [...]		        ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"SeoMix";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1418:"<div><img class="webfeedsFeaturedVisual" src="http://www.seomix.fr/wp-content/uploads/2016/11/inspecteur-gadget.jpg" /></div>Un consultant SEO doit-il se focaliser sur son domaine, pour lequel il est payé , ou doit-il conseiller son client sur un plan plus large ?<p><strong>Accédez à l\'article original :</strong> <a href="http://www.seomix.fr/depasser-cadre-seo/">Le référenceur doit-il uniquement se consacrer au SEO ?</a>.</p>\n    <p><strong>Voici le début du contenu :</strong> <p>Plusieurs exemples qui nous sont arrivés récemment nous ont donnés envie d’écrire cet article. Un consultant SEO doit-il se focaliser uniquement sur le domaine qu’il maîtrise, et pour lequel il est payé selon le devis, ou doit-il conseiller son client sur un plan plus large ?</p> <h2>Le consultant SEO : un apporteur de trafic qualifié</h2> <p>Tout d’abord, avant de vouloir voguer sur la mer, il faut être le maître de son étang. Un consultant SEO ne doit donc jamais oublier que sa mission principale est d’<strong>apporter du trafic sur le site de son client</strong>. Mais plus qu’un simple rabatteur, il est un sélectionneur. Le trafic se doit d’être qualifié. On se fiche un peu qu’un million de personnes viennent sur le site si aucune conversion n’est faite.</p> <p>Et c’est là, [...]</p><hr /><img src="http://feeds.feedburner.com/~r/wpfr/~4/0UBo7co6YHc" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feed