(19546, '_transient_dash_bd94b8f41e74bae2f4dc72e9bd8379af', '<div class="rss-widget"><ul><li><a class=\'rsswidget\' href=\'http://feedproxy.google.com/~r/WordpressFrancophone/~3/2P7jo3IVeaQ/\'>WPFR partenaire du WordCamp Bordeaux 2017</a> <span class="rss-date">9 novembre 2016</span><div class="rssSummary">L’équipe WPFR est fière de vous annoncer la mise en place d’un partenariat avec l’équipe organisatrice du WordCamp Bordeaux 2017. L’événement aura lieu le 18 mars 2017 dans la capitale girondine avec 300 participants attendus. Le WordCamp Bordeaux est attendu depuis de nombreuses années maintenant. L’idée avait été émise par les communautés locales (WPMX, meetupLire [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=\'rsswidget\' href=\'http://feedproxy.google.com/~r/wpfr/~3/9vMlLUQEQLI/\'>L’association WordPress francophone (WPFR)</a></li><li><a class=\'rsswidget\' href=\'http://feedproxy.google.com/~r/wpfr/~3/iw3Ng2fVxUs/\'>Les secrets pour réussir à travailler en équipe à distance</a></li><li><a class=\'rsswidget\' href=\'http://feedproxy.google.com/~r/wpfr/~3/pygAebhiwug/\'>Le point sur les certificats SSL, obligatoires en 2017</a></li></ul></div><div class="rss-widget"><ul><li class="dashboard-news-plugin"><span>Extensions populaires :</span> Meta Slider&nbsp;<a href="plugin-install.php?tab=plugin-information&amp;plugin=ml-slider&amp;_wpnonce=a628527fed&amp;TB_iframe=true&amp;width=600&amp;height=800" class="thickbox open-plugin-details-modal" aria-label="Installer Meta Slider">(Installer)</a></li></ul></div>', 'no'),
