(67, 1, '2015-10-08 11:27:23', '2015-10-08 10:27:23', '[vc_row][vc_column width="1/6" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][vc_single_image image="237" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][vc_column_text]\r\n<div style="width: 150px;">\r\n<h3 style="text-align: center;">Manger</h3>\r\n<h2 style="text-align: center;">La cuisine</h2>\r\n<p style="text-align: right;">territoire…\r\nsaison…\r\nhommes…\r\nfemmes…\r\ntechniques…\r\ncuisson…\r\nchasse…\r\npêche…\r\nculture…\r\nagriculture…\r\nmaraîchage…\r\nélevage…\r\ncueillette…\r\nsavoir faire…\r\nhumeur…\r\nune idée…</p>\r\n<p style="text-align: left;">…et prendre du plaisir.</p>\r\n\r\n</div>\r\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][vc_single_image image="237" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row]', 'La cuisine', '', 'publish', 'closed', 'closed', '', 'la-cuisine', '', '', '2016-01-04 17:22:38', '2016-01-04 16:22:38', '', 5, 'http://www.lagrenouillere.fr/?page_id=67', 0, 'page', '', 0),
(69, 1, '2015-10-08 11:27:48', '2015-10-08 10:27:48', '[vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6" offset="vc_hidden-xs"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6" offset="vc_hidden-xs"][/vc_column][vc_column width="1/3"][vc_column_text css=".vc_custom_1445607983863{padding-right: 20px !important;padding-left: 20px !important;}"]\r\n<h3 style="text-align: center;">Manger</h3>\r\n<h2 style="text-align: center;">Le restaurant</h2>\r\n<p style="text-align: justify;">Entre forge, fumoir et séchoir à houblon.\r\nOuvert la journée sur une nature verdoyante, le jardin de Tiphaine Hameau. La nuit tombant, l’obscurité venant la salle se renferme sur elle-même pour créer l’intimité sous un ciel étoilé.\r\nL’équipe de salle menée par Pascal Garnier vous accompagne dans ce moment de partage.</p>\r\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row]', 'Le restaurant', '', 'publish', 'closed', 'closed', '', 'le-restaurant', '', '', '2015-10-30 12:15:54', '2015-10-30 11:15:54', '', 5, 'http://www.lagrenouillere.fr/?page_id=69', 0, 'page', '', 0),
(71, 1, '2015-10-08 11:28:15', '2015-10-08 10:28:15', '[vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3"][vc_column_text]\r\n<h3 style="text-align: center;">Manger</h3>\r\n<h2 style="text-align: center;">La carte</h2>\r\n<p style="text-align: center;">Carte éditée chaque jour...\r\nCuisine, photographie gustative de l’instant.\r\nMenu 9 services : 95€\r\nMenu 11 services : 125€\r\nCarte de 35 à 85€</p>\r\n<p style="text-align: center;">La carte des vins se compose de près de 500 références. Elle propose des vins de toute la France, toutes ses régions. Elle est vivante, ouverte à tous, sans a priori.</p>\r\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row]', 'La carte', '', 'publish', 'closed', 'closed', '', 'la-carte', '', '', '2015-10-30 12:18:38', '2015-10-30 11:18:38', '', 5, 'http://www.lagrenouillere.fr/?page_id=71', 2, 'page', '', 0),
