(81, 1, '2015-10-08 11:32:09', '2015-10-08 10:32:09', '[vc_row][vc_column width="1/3"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row][vc_column width="1/3"][/vc_column][vc_column width="1/3"][vc_column_text]\r\n<h3 style="text-align: center;"><span style="color: #f8d09e;">Aller plus loin</span></h3>\r\n<h2 style="text-align: center;">Les alentours</h2>\r\n[/vc_column_text][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row css=".vc_custom_1445531296300{padding-right: 100px !important;padding-left: 100px !important;}"][vc_column][vc_row_inner][vc_column_inner width="1/4" offset="vc_hidden-sm vc_hidden-xs"][/vc_column_inner][vc_column_inner width="1/4"][vc_column_text]\r\n<p style="text-align: left;"><span style="font-weight: bold; font-size: 1.2em;">Golf : </span>\r\nLe touquet, Hardelot, Belle Dune</p>\r\n<span style="font-weight: bold; font-size: 1.2em;">Marchés: </span>\r\nMontreuil-sur-mer, à 2km : Samedi\r\nEtaples-sur-Mer, à 12km : Mercredi et Samedi\r\nLe Touqet-Paris-PLage, à 17km : Lundi (uniquement l\'été), Jeudi et Samedi\r\nHesdin, à 30km : Jeudi\r\nBoulogne-sur-Mer, à 40Km : Mercredi et Dimanche\r\n\r\n<span style="font-weight: bold; font-size: 1.2em;">Visite de nos producteurs</span>[/vc_column_text][/vc_column_inner][vc_column_inner width="1/4"][vc_column_text]\r\n<p style="text-align: left;"><span style="font-weight: bold; font-size: 1.2em;">Villes et plages : </span>\r\nLe Touquet (17Km), Le Crotoy (42Km),\r\nSaint Valery-sur-Somme (47km), Plage de Merlimont (13 km)\r\n<span style="font-weight: bold; font-size: 1.2em;">Culture :</span>\r\nAbbaye et Jardins de Valloires\r\nLa chartreuse de Neuville\r\nMusée d\'art contemporain du touquet\r\nLe Channel, Scène nationale de Calais</p>\r\nPlus encore sur <a href="http://www.tourisme-montreuillois.com/" target="_blank">www.tourisme-montreuillois.com</a>[/vc_column_text][/vc_column_inner][vc_column_inner width="1/4" offset="vc_hidden-sm vc_hidden-xs"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row css=".vc_custom_1445531296300{padding-right: 100px !important;padding-left: 100px !important;}"][vc_column offset="vc_hidden-lg vc_hidden-md vc_hidden-sm"][vc_row_inner][vc_column_inner width="1/4" offset="vc_hidden-sm vc_hidden-xs"][/vc_column_inner][vc_column_inner width="1/4"][vc_column_text]\r\n<p style="text-align: left;"><span style="font-weight: bold; font-size: 1.2em;">Golf : </span>\r\nLe touquet, Hardelot, Belle Dune\r\n<span style="font-weight: bold; font-size: 1.2em;">Marchés: </span>\r\nMontreuil-sur-mer, à 2km : Samedi\r\nEtaples-sur-Mer, à 12km : Mercredi et Samedi\r\nLe Touqet-Paris-PLage, à 17km : Lundi (uniquement l\'été), Jeudi et Samedi\r\n<span style="font-weight: bold; font-size: 1.2em;">Visite de nos producteurs</span></p>\r\n[/vc_column_text][/vc_column_inner][vc_column_inner width="1/4"][vc_column_text]\r\n<p style="text-align: left;"><span style="font-weight: bold; font-size: 1.2em;">Villes et plages : </span>\r\nLe Touquet (17Km), Le Crotoy (42Km), Saint Valery-sur-Somme (47km), Honfleur (212Km)\r\n<span style="font-weight: bold; font-size: 1.2em;">Culture :</span>\r\nAbbaye et Jardins de Valloires\r\nLa chartreuse de Neuville\r\nMusée d\'art contemporain du touquet</p>\r\nPlus encore sur <a href="http://www.tourisme-montreuillois.com/" target="_blank">www.tourisme-montreuillois.com</a>[/vc_column_text][/vc_column_inner][vc_column_inner width="1/4" offset="vc_hidden-sm vc_hidden-xs"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row][vc_column width="1/3"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row]', 'Les alentours', '', 'publish', 'closed', 'closed', '', 'les-alento