(87, 1, '2015-10-08 11:33:08', '2015-10-08 10:33:08', '[vc_row][vc_column width="2/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="237" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row][vc_column width="2/3"][vc_column_text]\r\n<h3 style="text-align: center;">Venir</h3>\r\n<h2 style="text-align: center;">Réserver</h2>\r\n<p style="text-align: center;">Pour vos réservation, merci de nous contacter :\r\n<a class="listButton" href="tel:+33321060722"> Tél. +33 3 21 06 07 22 </a>\r\n<a href="mailto:contact@lagrenouillere.fr">contact@lagrenouillere.fr</a></p>\r\n[/vc_column_text][vc_separator color="black" style="dashed" el_width="30"][vc_column_text]\r\n<h3 style="text-align: center;">Ouvertures</h3>\r\n<p style="text-align: center;"><strong>Printemps et Automne</strong>\r\n(Septembre, Octobre, Avril, Mai &amp; Juin)\r\nDéjeuner : Vendredi, Samedi et Dimanche\r\nDîner : Du Mercredi au Lundi</p>\r\n<p style="text-align: center;"><strong>Eté</strong>\r\n(Juillet et Août)\r\nDéjeuner et dîner : Tous les jours sauf les déjeuners du Lundi et du Mardi</p>\r\n<p style="text-align: center;"><strong>Hiver</strong>\r\n(Novembre à Mars inclus)\r\nDéjeuner : Vendredi, Samedi et Dimanche\r\nDîner : Du Jeudi au Lundi</p>\r\n[/vc_column_text][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row][vc_column width="2/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="237" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row]', 'Réserver', '', 'publish', 'closed', 'closed', '', 'reserver', '', '', '2016-07-05 09:39:26', '2016-07-05 08:39:26', '', 65, 'http://www.lagrenouillere.fr/?page_id=87', 0, 'page', '', 0),
