(128, 1, '2015-10-14 21:14:24', '2015-10-14 20:14:24', '[vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/3"][vc_column_text css_animation="bottom-to-top"]\r\n<h3 style="text-align: center;">Alexandre Gauthier</h3>\r\n<h2 style="text-align: center;">Cuisinier</h2>\r\n<p style="text-align: justify;">Je suis né cuisinier.\r\nJ’ai repris en 2003 le restaurant familial « La Grenouillère » situé près de Montreuil-sur-Mer dans le Pas de Calais.\r\nJ’y pratique une cuisine d’auteur, singulière, sincère. Je l’ancre avec humilité dans mon territoire de la côte d’Opale que j’explore dans tous ses aspects, naturels et humains. J’y propose une cuisine contemporaine de souche et de racine françaises, libérée de ses certitudes et de ses a priori.\r\nJ’ai confié en 2009 à l’architecte Patrick Bouchain la rénovation du restaurant pour en faire un lieu d’aujourd’hui. J’ai en effet l’ambition que La Grenouillère soit beaucoup plus qu’un grand restaurant.\r\nLa Grenouillère est une Maison de liberté et d’expression pour ceux qui l’habitent et la vivent avec moi.</p>\r\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row]', 'Cuisinier', '', 'publish', 'closed', 'closed', '', 'biographie', '', '', '2015-10-30 12:24:57', '2015-10-30 11:24:57', '', 61, 'http://www.lagrenouillere.fr/?page_id=128', 0, 'page', '', 0),
(130, 1, '2015-10-14 21:14:49', '2015-10-14 20:14:49', '[vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row css=".vc_custom_1446200325585{margin-right: 30px !important;margin-left: 30px !important;padding-right: 30px !important;padding-left: 30px !important;}"][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3"][vc_column_text]\r\n<h3 style="text-align: center;">Alexandre Gauthier</h3>\r\n<h2 style="text-align: center;">Contemporain</h2>\r\n<p style="text-align: justify;">Je pratique une cuisine contemporaine en proposant ma vision d’un goût et d’un territoire, qui assume pleinement qui je suis.\r\nÊtre contemporain, vivre dans son époque, c’est aussi dialoguer avec d’autres univers, recevoir des marques d’estime, faire voyager sa cuisine en dehors des frontières.\r\nLa Grenouillère est une maison de cuisinier, une maison de partage, de liberté et d’expression. 12 ans de travail, de rencontres, d’échanges, de passion et d’envies au quotidien, jour après jour, mois après mois…12 ans de mouvement permanent.\r\nJ’aime cette recette de Daniel Rondeau <em>« La meilleure façon de préparer l’avenir est de tout donner au présent »</em>.</p>\r\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6" offset="vc_hidden-sm vc_hidden-xs"][/vc_column][vc_column width="1/6" offset="vc_hidden-sm vc_hidden-xs"][/vc_column][vc_column width="1/6" offset="vc_hidden-sm vc_hidden-xs"][/vc_column][vc_column width="1/3" offset="vc_hidden-xs"][vc_separator color="chino" style="dotted"][vc_empty_space height="20"][vc_row_inner][vc_column_inner width="1/6"][vc_btn title="2016" style="outline" shape="sq