(141, 1, '2015-10-14 21:25:43', '2015-10-14 20:25:43', '[vc_row][vc_column width="1/4"][/vc_column][vc_column width="1/2" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/4"][/vc_column][/vc_row][vc_row][vc_column width="1/4"][/vc_column][vc_column width="1/2"][vc_column_text]\r\n<h3 style="text-align: center;">Dormir</h3>\r\n<h2 style="text-align: center;">Séjours et petits déjeuners</h2>\r\n[/vc_column_text][vc_row_inner][vc_column_inner width="1/2"][vc_column_text]\r\n<h4 style="text-align: center;">Séjours</h4>\r\n<p style="text-align: center;">En semaine du Dimanche au Jeudi\r\n1 nuit + petits déjeuners\r\n2 menus dégustation (en 9 services) à la Grenouillère\r\nVin, cafés et eau compris\r\n2 personnes : 600€\r\nSauf Vendredi, Samedi et veille de jours fériés</p>\r\n[/vc_column_text][/vc_column_inner][vc_column_inner width="1/2"][vc_column_text]\r\n<h4 style="text-align: center;">Petits déjeuners</h4>\r\n<p style="text-align: center;">De 8h00 à 10h30\r\nPetit déjeuner\r\nServi en salle, en exterieur ou en chambre.\r\n22,50€</p>\r\n[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][vc_column width="1/4"][/vc_column][/vc_row][vc_row][vc_column width="1/4"][/vc_column][vc_column width="1/2" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/4"][/vc_column][/vc_row]', 'Séjours et petits déjeuners', '', 'publish', 'closed', 'closed', '', 'sejours-et-petits-dejeuners-2', '', '', '2015-10-29 16:12:16', '2015-10-29 15:12:16', '', 15, 'http://www.lagrenouillere.fr/?page_id=141', 0, 'page', '', 0);
