(564, 2, '2015-12-29 15:57:52', '2015-12-29 14:57:52', '<p style="font-size:14px;">Depuis Juillet 2007, Création et ouverture de Froggy’s Tavern, rôtisserie contemporaine à Montreuil-sur-Mer (62) en collaboration avec Willam Elliott</p>\r\n\r\n<p style="font-size:14px;">*Sacré «Grand Chef de demain» par le Gault & Millau</p>\r\n\r\n<p style="font-size:14px;"><strong>Invitations</strong>\r\n*Naples, Italie, Capri Palace Octobre 2007 extravagancia by Enzo Caldareli\r\n*Rekiavik, Islande, février 2007, Food and Fun Festival\r\n*Paris, Tool’s Food avec Stéphane Bureaux</p>\r\n\r\n<p style="font-size:14px;"><a href="http://www.atabula.com/ alexandre-gauthier- grenouillere-grand-entretien/">http://www.atabula.com/ alexandre-gauthier- grenouillere-grand-entretien/</a></p>', '2007', '', 'publish', 'closed', 'closed', '', '2007', '', '', '2016-05-02 11:20:43', '2016-05-02 10:20:43', '', 0, 'http://www.lagrenouillere.fr/?post_type=popup&#038;p=564', 0, 'popup', '', 0),
(576, 2, '2016-01-04 13:19:21', '2016-01-04 12:19:21', '[vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/3"][vc_column_text css_animation="bottom-to-top"]\r\n<h3 style="text-align: center;">Alexandre Gauthier</h3>\r\n<h2 style="text-align: center;">Chef</h2>\r\n<p style="text-align: justify;">I was born a chef.\r\nIn 2003, I took over the family restaurant “La Grenouillère” near Montreuil-sur-Mer in the Pas-de-Calais region.\r\nThere, I elaborate a unique, authentic, signature cuisine. I humbly anchor it in my region, in the Côte d’Opale which I explore in all its aspects, natural and human. I offer a true French-rooted contemporary cuisine, freed of its convictions and its prejudice.\r\nIn 2009, I entrusted the architect Patrick Bouchain with the renovation of the restaurant, to make it into a place of today. I strive for more, such as La Grenouillère being more than just a great restaurant.\r\nLa Grenouillère is a house of freedom and expression for those who live in it and live it with me.</p>\r\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row]', 'Chef', '', 'publish', 'closed', 'closed', '', 'chef', '', '', '2016-01-04 18:15:58', '2016-01-04 17:15:58', '', 600, 'http://www.lagrenouillere.fr/?page_id=576', 0, 'page', '', 0),
