(604, 2, '2016-01-04 18:23:02', '2016-01-04 17:23:02', '[vc_row][vc_column width="1/3"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row][vc_column width="1/3"][/vc_column][vc_column width="1/3"][vc_column_text]\r\n<h3 style="text-align: center;"><span style="color: #f8d09e;">Explore more</span></h3>\r\n<h2 style="text-align: center;">The surroundings</h2>\r\n[/vc_column_text][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row css=".vc_custom_1445531296300{padding-right: 100px !important;padding-left: 100px !important;}"][vc_column][vc_row_inner][vc_column_inner width="1/4" offset="vc_hidden-sm vc_hidden-xs"][/vc_column_inner][vc_column_inner width="1/4"][vc_column_text]\r\n<p style="text-align: left;"><span style="font-weight: bold; font-size: 1.2em;">Golf : </span>\r\nLe touquet, Hardelot, Belle Dune</p>\r\n<span style="font-weight: bold; font-size: 1.2em;">Markets: </span>\r\nMontreuil-sur-Mer, 2km away: Saturday\r\nEtaples-sur-Mer, 12km away: Wednesday and Saturday\r\nLe Touquet-Paris-Plage, 17km away: Monday (summers only), Thursday and Saturday\r\nHesdin, 30km away: Thursday\r\nBoulogne-sur-Mer, 40Km away: Wednesday and Sunday\r\n\r\n<span style="font-weight: bold; font-size: 1.2em;">Visit our producers</span>[/vc_column_text][/vc_column_inner][vc_column_inner width="1/4"][vc_column_text]\r\n<p style="text-align: left;"><span style="font-weight: bold; font-size: 1.2em;">Cities and beaches:</span>\r\nLe Touquet (17Km), Le Crotoy (42Km),\r\nSaint Valery-sur-Somme (47km), Honfleur (212Km)\r\n<span style="font-weight: bold; font-size: 1.2em;">Culture:</span>\r\nThe abbey and the Jardins de Valloires\r\nThe monastery la chartreuse de Neuville\r\nThe Touquet contemporary art museum\r\nLe Channel, Calais national scene</p>\r\nFind more on <a href="http://www.tourisme-montreuillois.com/" target="_blank">www.tourisme-montreuillois.com</a>[/vc_column_text][/vc_column_inner][vc_column_inner width="1/4" offset="vc_hidden-sm vc_hidden-xs"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row css=".vc_custom_1445531296300{padding-right: 100px !important;padding-left: 100px !important;}"][vc_column offset="vc_hidden-lg vc_hidden-md vc_hidden-sm"][vc_row_inner][vc_column_inner width="1/4" offset="vc_hidden-sm vc_hidden-xs"][/vc_column_inner][vc_column_inner width="1/4"][vc_column_text]\r\n<p style="text-align: left;"><span style="font-weight: bold; font-size: 1.2em;">Golf : </span>\r\nLe touquet, Hardelot, Belle Dune</p>\r\n<span style="font-weight: bold; font-size: 1.2em;">Markets: </span>\r\nMontreuil-sur-Mer, 2km away: Saturday\r\nEtaples-sur-Mer, 12km away: Wednesday and Saturday\r\nLe Touquet-Paris-Plage, 17km away: Monday (summers only), Thursday and Saturday\r\n\r\n<span style="font-weight: bold; font-size: 1.2em;">Visit our producers</span>[/vc_column_text][/vc_column_inner][vc_column_inner width="1/4"][vc_column_text]\r\n<p style="text-align: left;"><span style="font-weight: bold; font-size: 1.2em;">Cities and beaches:</span>\r\nLe Touquet (17Km), Le Crotoy (42Km), Saint Valery-sur-Somme (47km), Honfleur (212Km)\r\n<span style="font-weight: bold; font-size: 1.2em;">Culture:</span>\r\nThe abbey and the Jardins de Valloires\r\nThe monastery la chartreuse de Neuville\r\nThe Touquet contemporary art museum</p>\r\nFind more on <a href="http://www.tourisme-montreuillois.com/" target="_blank">www.tourisme-montreuillois.com</a>[/vc_column_text][/vc_column_inner][vc_column_inner width="1/4" offset="vc_hidden-sm vc_hidden-xs"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row][vc_column width="1/3"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row]', 'The surroundings', '