(610, 2, '2016-01-04 18:31:40', '2016-01-04 17:31:40', '[vc_row][vc_column width="1/3"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="237" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row][vc_column width="1/3"][/vc_column][vc_column width="1/3"][vc_column_text]\r\n<h3 style="text-align: center;">Visit us</h3>\r\n<h2 style="text-align: center;">Acces</h2>\r\n<p style="text-align: center;">La Grenouillère, 19 rue de la Grenouillère 62170 La Madelaine-sous-Montreuil\r\n(<a href="https://goo.gl/maps/iFqbb18qNU82" target="_blank">open in google maps</a>)</p>\r\n[/vc_column_text][vc_separator color="chino" style="dotted" el_width="20" el_class="hr_acces"][vc_column_text]\r\n<h3 style="text-align: center;">By car</h3>\r\n<p style="text-align: center;">GPS coordinates\r\nLatitude 50.4707957 - Longitude 1.7546691999999</p>\r\n[/vc_column_text][vc_separator color="chino" style="dotted" el_width="20" el_class="hr_acces"][vc_column_text]\r\n<h3 style="text-align: center;">By train</h3>\r\n<p style="text-align: center;"><a href="http://www.ter.sncf.com/nord-pas-de-calais/gares/87317164/Montreuil%20sur%20Mer/prochains-departs" target="_blank">Train station de Montreuil-sur-Mer</a>, 4 km away\r\n<a href="http://www.gares-sncf.com/fr/gare/frcvu/rang-du-fliers-verton-berck" target="_blank">Train station de Rang-du-Fliers</a>, 12 km away\r\n<a href="http://www.gares-sncf.com/fr/gare/freta/etaples-touquet" target="_blank">Train station d\'Etaples le Touquet</a>, 12 km away\r\nTaxi service upon reservation from the station to La Grenouillère:\r\nAllo Taxi Montreuil +33669380100</p>\r\n[/vc_column_text][vc_separator color="chino" style="dotted" el_width="20" el_class="hr_acces"][vc_column_text]\r\n<h3 style="text-align: center;">By helicopter...</h3>\r\n<p style="text-align: center;">Landing at La Grenouillère available by appointment only.</p>\r\n[/vc_column_text][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row][vc_column width="1/3"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="237" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row]', 'Access', '', 'publish', 'closed', 'closed', '', 'access', '', '', '2016-01-04 18:31:40', '2016-01-04 17:31:40', '', 608, 'http://www.lagrenouillere.fr/?page_id=610', 0, 'page', '', 0),
(612, 2, '2016-01-04 18:35:02', '2016-01-04 17:35:02', '[vc_row][vc_column width="2/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="237" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row][vc_column width="2/3"][vc_column_text]\r\n<h3 style="text-align: center;">Visit us</h3>\r\n<h2 style="text-align: center;">Make a reservation</h2>\r\n<p style="text-align: center;">Please contact us for your reservations:\r\n<a class="listButton" href="tel:+33321060722"> Phone +33 3 21 06 07 22 </a>\r\n<a href="mailto:contact@lagrenouillere.fr">contact@lagrenouillere.fr</a></p>\r\n[/vc_column_text][vc_separator color="black" style="dashed" el_width="30"][vc_column_text]\r\n<h3 style="text-align: center;">Open</h3>\r\n<p style="text-align: center;"><strong>Spring and Fall</strong>\r\n(September, October, April, May &amp; June)\r\nLunch: Friday, Saturday and Sunday\r\nDinner: From Wednesday to Monday</p>\r\n<p style="text-align: center;"><strong>Summer</strong>\r\n(July and August)\r\nLunch and dinner: Every day except lunch on Tuesdays</p>\r\n<p style="text-align: center;"><strong>Winter</strong>\r\n(November to March- included)\r\nLunch: Friday, Saturday and Sunday\r\nDinner: From Thursday to Monday</p>\r\n[/vc_column_text][/vc_column][vc_column width="1/3"][/vc_column][/vc_row][vc_row][vc_column width="2/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="237" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row]', 'Make a reservation', '', 'publish', 'closed', 'closed', '', 'make-a-reservation', '', '', '2016-01-04 18:36:28', '2016-01-04 17:36:28', '', 608, 'http://www.lagrenouillere.fr/?page_id=612', 0, 'page', '', 0),
