(616, 2, '2016-01-04 18:39:09', '2016-01-04 17:39:09', '[vc_row][vc_column width="1/4"][/vc_column][vc_column width="1/2" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/4"][/vc_column][/vc_row][vc_row][vc_column width="1/4"][/vc_column][vc_column width="1/2"][vc_column_text]\r\n<h3 style="text-align: center;">Sleep</h3>\r\n<h2 style="text-align: center;">Stays and breakfast</h2>\r\n[/vc_column_text][vc_row_inner][vc_column_inner width="1/2"][vc_column_text]\r\n<h4 style="text-align: center;">Stays</h4>\r\n<p style="text-align: center;">Weekdays from Sunday to Thursday\r\n1 night + breakfast\r\n2 tasting menus (9 courses) at la Grenouillère\r\nWine, coffee and water included\r\n2 persons: €600\r\nNot valid on Friday, Saturday and on eve of public holiday</p>\r\n[/vc_column_text][/vc_column_inner][vc_column_inner width="1/2"][vc_column_text]\r\n<h4 style="text-align: center;">Breakfast</h4>\r\n<p style="text-align: center;">From 8h00 to 10h30\r\nBreakfast\r\nTable service, outdoor service or room service.\r\n€22.50</p>\r\n[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][vc_column width="1/4"][/vc_column][/vc_row][vc_row][vc_column width="1/4"][/vc_column][vc_column width="1/2" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/4"][/vc_column][/vc_row]', 'Stays and breakfast', '', 'publish', 'closed', 'closed', '', 'stays-and-breakfast', '', '', '2016-01-05 09:00:55', '2016-01-05 08:00:55', '', 614, 'http://www.lagrenouillere.fr/?page_id=616', 0, 'page', '', 0),
