(626, 2, '2016-01-05 09:21:52', '2016-01-05 08:21:52', '[vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row css=".vc_custom_1446200325585{margin-right: 30px !important;margin-left: 30px !important;padding-right: 30px !important;padding-left: 30px !important;}"][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3"][vc_column_text]\r\n<h3 style="text-align: center;">Alexandre Gauthier</h3>\r\n<h2 style="text-align: center;">Contemporary</h2>\r\n<p style="text-align: justify;">I promote contemporary cuisine by offering my vision of a taste and a territory, which fully embraces who I am.\r\nBeing contemporary, keeping up with the times, is also about conversing with other worlds, receiving critical esteem, sending your cuisine beyond borders.\r\nLa Grenouillère is a house for chefs, for sharing, and a house of freedom and expression. 12 years of daily work, meetings, exchanges, passion and desires, day after day, month after month... 12 years of constant motion.\r\nI love this Daniel Rondeau recipe <em>"The best way to prepare for the future consists in giving everything to the present."</em></p>\r\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6" offset="vc_hidden-lg vc_hidden-md vc_hidden-sm vc_hidden-xs"][/vc_column][vc_column width="1/6" offset="vc_hidden-lg vc_hidden-md vc_hidden-sm vc_hidden-xs"][/vc_column][vc_column width="1/6" offset="vc_hidden-lg vc_hidden-md vc_hidden-sm vc_hidden-xs"][/vc_column][vc_column width="1/3" offset="vc_hidden-lg vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_separator color="chino" style="dotted"][vc_empty_space height="20"][vc_row_inner][