(631, 2, '2016-01-05 09:26:54', '2016-01-05 08:26:54', '[vc_row][vc_column width="1/6" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][vc_single_image image="237" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][vc_column_text]\r\n<div style="width: 150px;">\r\n<h3 style="text-align: center;">Eat</h3>\r\n<h2 style="text-align: center;">The kitchen</h2>\r\n<p style="text-align: right;">territory…\r\nseason…\r\nmen…\r\nwomen…\r\ntechniques…\r\ncooking…\r\nhunting…\r\nfishing…\r\nculture…\r\nagriculture…\r\ngathering…\r\nfarming…\r\nharvest…\r\nsavoir faire…\r\nhumor…\r\nan idea…</p>\r\n<p style="text-align: left;">…and take pleasure in it.</p>\r\n\r\n</div>\r\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][vc_single_image image="237" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row]', 'The kitchen', '', 'publish', 'closed', 'closed', '', 'the-kitchen', '', '', '2016-01-05 09:26:54', '2016-01-05 08:26:54', '', 629, 'http://www.lagrenouillere.fr/?page_id=631', 0, 'page', '', 0),
(633, 2, '2016-01-05 09:31:45', '2016-01-05 08:31:45', '[vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6" offset="vc_hidden-xs"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6" offset="vc_hidden-xs"][/vc_column][vc_column width="1/3"][vc_column_text css=".vc_custom_1451982696688{padding-right: 20px !important;padding-left: 20px !important;}"]\r\n<h3 style="text-align: center;">Eat</h3>\r\n<h2 style="text-align: center;">The restaurant</h2>\r\n<p style="text-align: justify;">Between a smithy, a smokehouse and a hop dryer.\r\nIt opens out during the day onto a verdant nature, the Tiphaine Hameau garden.\r\nWhen night falls and darkness comes, the dining area closes in on itself to induce coziness under a starry sky.\r\nThe waiting staff led by Pascal Garnier will assist you during this time of sharing.</p>\r\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row]', 'The restaurant', '', 'publish', 'closed', 'closed', '', 'the-restaurant', '', '', '2016-01-05 09:33:37', '2016-01-05 08:33:37', '', 629, 'http://www.lagrenouillere.fr/?page_id=633', 0, 'page', '', 0),
(635, 2, '2016-01-05 09:42:31', '2016-01-05 08:42:31', '[vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3"][vc_column_text]\r\n<h3 style="text-align: center;">Eat</h3>\r\n<h2 style="text-align: center;">The menu</h2>\r\n<p style="text-align: center;">The menu is edited daily…\r\nCuisine, instantaneous taste photography.\r\nMenu 9 courses: €95\r\nMenu 11 courses: €125\r\nÀ la Carte from 35 to €85</p>\r\n<p style="text-align: center;">The wine list consists of almost 500 references. It offers wines from all over France and all its regions. It is alive, open to all, without prejudice.</p>\r\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/6"][/vc_column][vc_column width="1/3" offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/6"][/vc_column][/vc_row]', 'The menu', '', 'publish', 'closed', 'closed', '', 'the-menu', '', '', '2016-01-05 09:44:18', '2016-01-05 08:44:18', '', 629, 'http://www.lagrenouillere.fr/?page_id=635', 2, 'page', '', 0),
