(720, 2, '2016-02-19 10:07:49', '2016-02-19 09:07:49', '<p style="font-size:14px;">*La Grenouillère, Première étoile Michelin pour le guide Michelin</p>\r\n\r\n<p style="font-size:14px;"><strong>Rencontres</strong>\r\n*Duo à la scène nationale de Calais Peter De Bie, Artiste belge, directeur artistique de la compagnie « Laïka »\r\n*Patrick Bouchain, Architecte, scénographe « Construire et Reconstruire »2008\r\n*Parick Bouchain au « Paris des Chefs », à Paris</p>\r\n\r\n<p style="font-size:14px;"><strong>Invitations</strong>\r\n*Naples, Italie, Capri Palace Octobre 2008 extravagancia by Enzo Caldareli\r\n*Santiago, Espagne, Février 2008, forum gastronomico\r\n*Omnivore food festival Paris N°3, 2ème participation, scène salée</p>', '2008', '', 'publish', 'closed', 'closed', '', '2008', '', '', '2016-05-02 11:19:15', '2016-05-02 10:19:15', '', 0, 'http://www.lagrenouillere.fr/?post_type=popup&#038;p=720', 0, 'popup', '', 0),
(722, 2, '2016-02-19 10:09:23', '2016-02-19 09:09:23', '<p style="font-size:14px;"><strong>Invitations</strong>\r\n*Megève ‘Flocon de Sel‘ Octobre 2009, Collection 2009 by Enzo Caldareli\r\n*New York Septembre 2009,Omnivore Food Festival\r\n*Belgique Septembre 2009, ‘In de Wulf ‘ Dinée Chef Party\r\n*Tokyo-Fou de France Mars 2009 Japon,,Restaurant ‘Beige’\r\n*Stratford, Canada. School chef Février 2009 chef résident\r\n*Madrid, Espagne, Janvier 2009 Madrid Fusion Festival\r\n*Omnivore food festival Paris N°4, 3ème participation, scène salée</p>', '2009', '', 'publish', 'closed', 'closed', '', '2009', '', '', '2016-05-02 11:18:14', '2016-05-02 10:18:14', '', 0, 'http://www.lagrenouillere.fr/?post_type=popup&#038;p=722', 0, 'popup', '', 0),
(725, 2, '2016-02-19 10:12:35', '2016-02-19 09:12:35', '<p style="font-size:14px;">Fermeture le 30 octobre 2010 de l’ancienne Grenouillère pour 6 mois. Démolition de la cuisine et des arrières le 2 novembre. Les architectes Patrick Bouchain, Loïc Julienne et Benoît Morin ont le destin d’une famille et d’un lieu entre leurs main…</p>\r\n\r\n<p style="font-size:14px;">*Créateur de l’année omnivore\r\n*La Grenouillère, Quatre points au Champérard (19/20)\r\n*La Grenouillère, 76ème best restaurant of the world by Restaurant Magazine</p>\r\n\r\n<p style="font-size:14px;"><strong>Rencontres\r\n</strong>*Duo à la scène nationale de Calais Jean Marie Songie, Directeur de la scène nationale de Chalon en champagne et directeur du festival d’Aurillac\r\n*Andrea Petrini, Critique et activiste culinaire mondial\r\n*Francis Peduzzi, Directeur de la scène nationale du Channel, « 999 »</p>\r\n\r\n<p style="font-size:14px;"><strong>Invitations\r\n</strong>*Tokyo Décembre 2010 FSCC- Dîner de Gala\r\n*Sydney Octobre 2010- Sydney food festival\r\n*San Francisco Septembre 2010-Restaurant Manresa-Exibition; Dîner de Gala\r\n*Londres Juin 2010 Identita Golosa Masterclass- repas de Gala-performences\r\n*New York Juin 2010 Omnivore Food festival\r\n*Londres Avril 2010 50 best restaurant of the world\r\n*Milan avril 2010 Design week Scholtes\r\n*Kyoto et Tokyo Mars 2010 repas de Gala Itoh company\r\n*Deauville Février 2010 Omnivore Food festival\r\n*Omnivore food festival Paris N°5, 4ème participation, scène salée</p>', '2010', '', 'publish', 'closed', 'closed', '', '2010', '', '', '2016-05-02 11:17:48', '2016-05-02 10:17:48', '', 0, 'http://www.lagrenouillere.fr/?post_type=popup&#038;p=725', 0, 'popup', '', 0),
(727, 2, '2016-02-19 10:14:00', '2016-02-19 09:14:00', '<p style="font-size:14px;">La Grenouillère fait peau neuve, Fin avril, restaurant en « rodage » après 6 mois de travaux, passage dans le 21ème siècle..</p>\r\n\r\n<p style="font-size:14px;"><strong>Marques d’estime</strong>\r\n*La Grenouillère, 78eme best restaurant of the world « 50 best »\r\n*Sacré «Trentenaire qui compte» par le Figaro Magazine</p>\r\n\r\n<p style="font-size:14px;"><strong>Rencontres</strong>\r\n*Duo artistique à la scène nationale de Calais avec François de la Rosière,  Directeur artistique de la compagnie La Machine à Nantes, « Dîner des petites mécaniques »</p>\r\n\r\n<p style="font-size:14px;"><strong>Invitations</strong>\r\n*San Sébastian, Espagne, Novembre 2011, «Lo mejor de la gastronomia»\r\n*Kamasawa, Japon, Novembre 2011«Cook it raw»\r\n*Milan Mai 2011 Scala- Dîner de Gala\r\n*Stratford, Canada School chef Janvier 2011-chef résident\r\n*Omnivore food festival Paris N°6, 5ème participation, scène salée</p>', '2011', '', 'publish', 'closed', 'closed', '', '2011', '', '', '2016-05-02 11:17:02', '2016-05-02 10:17:02', '', 0, 'http://www.lagrenouillere.fr/?post_type=popup&#038;p=727', 0, 'popup', '', 0),
(729, 2, '2016-02-19 10:15:13', '2016-02-19 09:15:13', '<p style="font-size:14px;">*Chevalier des Arts et des lettres, Ministère de la Culture\r\n*Créateur de l\'année Omnivore pour la deuxième fois\r\n*Emprunte de l\'année,  Centre du luxe et de la création\r\n*« The one to Watch » 50 Best Restaurants\r\n*La Grenouillère, 19/20 Guide Champérard\r\n*La Grenouillère, 4 Toques Gault &amp; Millau\r\n*La Grenouillère, 81ème 50 Best Restaurants\r\n*Prix spécial du Fooding</p>\r\n\r\n<p style="font-size:14px;"><strong>Rencontres\r\n</strong>*Duo artistique à la scène nationale de Calais avec  Etienne Saglio, Théoriste de la magie « Dîner magique »</p>\r\n\r\n<p style="font-size:14px;"><strong>Invitations</strong>\r\n*Pologne, Cook it Raw\r\n*New York, Starchef\r\n*Avignon, Forum d’Avignon avec Pierre Hermé\r\n*Monaco, 25ème anniversaire du Louis XV d’Alain Ducasse\r\n*Omnivore food festival Paris N°7, 6ème participation, 1ère scène sucrée</p>', '2012', '', 'publish', 'closed', 'closed', '', '2012', '', '', '2016-05-02 11:16:18', '2016-05-02 10:16:18', '', 0, 'http://www.lagrenouillere.fr/?post_type=popup&#038;p=729', 0, 'popup', '', 0),
(731, 2, '2016-02-19 10:16:08', '2016-02-19 09:16:08', '<p style="font-size:14px;">La Grenouillère devient Relais & Château</p>\r\n\r\n<p style="font-size:14px;">*Sélectionné pour être Chef de l’année Gault &amp; Millau, face à Arnaud Lallemant</p>\r\n\r\n<p style="font-size:14px;"><strong>Invitations</strong>\r\n*Venise, Réalisation du dîner pour l’inauguration du Pavillon français de la Biennale d’art contemporain\r\n*Vilnius, Dinner in the Sky\r\n*Omnivore food festival Paris N°8, 7ème participation, scène salée</p>', '2013', '', 'publish', 'closed', 'closed', '', '2013', '', '', '2016-05-02 11:15:29', '2016-05-02 10:15:29', '', 0, 'http://www.lagrenouillere.fr/?post_type=popup&#038;p=731', 0, 'popup', '', 0),
(733, 2, '2016-02-19 10:17:30', '2016-02-19 09:17:30', '<p style="font-size:14px;">Mai 2014, Sortie du livre « Alexandre Gauthier, Cuisinier » en France</P\r\n\r\n<p style="font-size:14px;">*5 toques Gault &amp; Millau\r\n*Élu 2e personne la plus influente de la Gastronomie Française par Gmag\r\n*La Grenouillère, « One of the Most delicious places to be » Bon appetit Magazine\r\n*Livre « Alexandre Gauthier, Cuisinier » Prix Eugénie Brazier de la meilleure image\r\n*Livre « Alexandre Gauthier, Cuisinier » Prix du meilleur livre gourmand Figaro</p>\r\n\r\n<p style="font-size:14px;"><strong>Rencontres</strong>\r\n*Georges Rousseau, réalisation de  4 oeuvres à La Grenouillère.</p>\r\n\r\n<p style="font-size:14px;"><strong>Invitations</strong>\r\n*Salzbourg, Invité en tant que Chef au Ikarus restaurant « Hangar 7 »\r\n*Singapour, Participation au « World Gourmet Summit »\r\n*Bruxelles,  Participation au festival « Culinaria », « Le festin étranger »\r\n*Copenhague,  Participation au festival MAD\r\n*San Francisco,  Charity Dinner «12 days of Christmas » à Meadowood, 4 Mains avec Christopher Kostow\r\n*Omnivore food festival Paris N°9, 8ème participation, scène salée</p>', '2014', '', 'publish', 'closed', 'closed', '', '2014', '', '', '2016-05-02 11:14:40', '2016-05-02 10:14:40', '', 0, 'http://www.lagrenouillere.fr/?post_type=popup&#038;p=733', 0, 'popup', '', 0),
(735, 2, '2016-02-19 10:18:38', '2016-02-19 09:18:38', '<p style="font-size:14px;">Depuis Février 2015, Création et ouverture du restaurant Anecdote, Cuisine de mémoire à Montreuil-sur-Mer (62)</p>\r\n\r\n<p style="font-size:14px;"><strong>Rencontres</strong>\r\n*Juin, Duo artistique à la scène nationale de Calais avec la compagnie 2 rien Merci « Marais luisant »\r\n*Août, Exposition « Georges Rousse au fond du jardin »</p>\r\n\r\n<p style="font-size:14px;"><strong>Invitations</strong>\r\n*Conférence dans l’école d’architecture ENSA à Paris « Assumer ce que l’on est, chez soi »\r\n*Omnivore food festival Paris N°10, 9ème participation, scène salée\r\n*Juillet, Participation au « Shuffle Gélinaz », dîner à la Calandre de Massimiliano et Raffaele Alajmo.\r\n*Omnivore Londres n°1, 1ère participation\r\n*Venise, Septembre, Déjeuner de Charité « El gusto per la ricerca » avec Massimiliano Alajmo, Fluvio Perangelini, Pino Cuttaia et Eugenio Paul</p>', '2015', '', 'publish', 'closed', 'closed', '', '2015', '', '', '2016-05-02 11:13:42', '2016-05-02 10:13:42', '', 0, 'http://www.lagrenouillere.fr/?post_type=popup&#038;p=735', 0, 'popup', '', 0),
(737, 2, '2016-02-19 10:19:25', '2016-02-19 09:19:25', '<p style="font-size: 14px;">*1er au classement des trentenaires qui comptent par Atabula\r\n*Cuisinier  de l’année, Gault &amp; Millau\r\n*Fooding d’honneur, Le Fooding</p>\r\n<p style="font-size: 14px;"><strong>Invitations</strong></p>\r\n<p style="font-size: 14px;">*Participation au dîner de la Cop 21, signature du plat principal\r\n*Démonstration au congrès "Chef Sache" à Dublin\r\n*Dîner 4 mains avec Mauro Collagrecco pour « Gelinaz » en Belgique (Bruxelles)\r\n*Projet « Feel Tokyo » invité à découvrir la ville et partager l’expérience en France\r\n*Dîners spéciaux "Chefs Club » aux Etats-Unis (New York)\r\n*Intervention au congrès « Food for Thought » au Japon (Tokyo) en tant que membre Relais &amp; Château\r\n*Madrid fusion, participation au Food festival, Madrid\r\n*Dîners de gala à Singapour, « Gourmet Summit »\r\n*Démonstration culinarie en Italie (Paestum), congrès « Le Stade della Mozarella »</p>', '2016', '', 'publish', 'closed', 'closed', '', '2016', '', '', '2016-12-02 17:37:46', '2016-12-02 16:37:46', '', 0, 'http://www.lagrenouillere.fr/?post_type=popup&#038;p=737', 0, 'popup', '', 0),
(755, 2, '2016-02-22 12:06:18', '2016-02-22 11:06:18', '[vc_row][vc_column width="1/3"][vc_single_image image="120" alignment="center" css_animation="top-to-bottom"][vc_column_text]\r\n<h3 style="text-align: center;">Alexandre Gauthier</h3>\r\n<h2 style="text-align: center;">Biographie</h2>\r\n<p style="text-align: justify;">Alexandre Gauthier né le 26 mars 1979 à Boulogne-sur-Mer est un chef cuisinier français. Propriétaire du restaurant La Grenouillère situé à La Madelaine-sous-Montreuil dans le Pas-de-Calais. Il est le fils de Roland Gauthier.</p>\r\n<p style="text-align: justify;">En février 2003, il reprend les cuisines de La Grenouillère qui appartenaient à son père. Créée dans les années 1930, l’auberge était dirigée par Roland Gauthier depuis 1979. En 2007, il ouvre une rôtisserie contemporaine « Froggy’s Tavern » à Montreuil-sur-Mer et en 2009 « Les grandes tables du Channel » à Calais puis en 2015 «Anecdote» à Montreuil-sur-Mer. Il participe à de nombreux festivals et colloques où il présente sa cuisine en France et à l\'étranger.</p>\r\n[/vc_column_text][vc_single_image image="120" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/3"][/vc_column][vc_column width="1/3"][/vc_column][/vc_row]', 'Contact', '', 'publish', 'closed', 'closed', '', 'contact', '', '', '2016-02-22 12:10:01', '2016-02-22 11:10:01', '', 0, 'http://www.lagrenouillere.fr/?page_id=755', 0, 'page', '', 0),
